                const Subject = $(""#Subject"").val()
                const Description = $(""#Description"").val()

                if (!MessangeValidation(UserId, FullName, Email, Subject, Description)) {
                    console.log(""Not validated"")
                    return;
                }

                Swal.fire({
                    title: 'Give me a second.',
